import { StyleSheet, Text, View } from 'react-native'

import React from 'react'

import { createDrawerNavigator, DrawerContentScrollView, DrawerItem, DrawerItemList } from '@react-navigation/drawer'

import { Drawer } from 'react-native-paper'
import { Button } from 'native-base';

function CustomDrawerContent(props) {
    return (
      <DrawerContentScrollView {...props}>
          <Button></Button>

          <Drawer.Item 
             icon="star"
             label="First Item"
          />

      </DrawerContentScrollView>
    );
  }

const IntakeScreen = ({ route }) => {
  const Drawer = createDrawerNavigator()

  return (
    <Drawer.Navigator drawerContent={(props) => <CustomDrawerContent {...props} />}  screenOptions={{
        drawerType: 'permanent',

        headerShown: false,
    }}>
      <Drawer.Screen name='intake' component={MyComponent} />    

    </Drawer.Navigator>
  )
}

export default IntakeScreen

const styles = StyleSheet.create({})

function MyComponent({ navigation }) {

  return (
    <View>
      <Text onPress={() => navigation.navigate('Login')}>IntakeScreen</Text>
    </View>
  )
}
